import React from "react";
import ReactDom from "react-dom";
import "./index.css";

const attrIbutes = [
  { title: "title" },
  { author: "author" },
  { img: "https://m.media-amazon.com/images/I/61JSKZ6vHQS._AC_UY218_.jpg" },
];

function BookList() {
  return (
    <section className="booklist">
      <Book {...attrIbutes} />
    </section>
  );
}

const namesList = [{ name: "Nume 1" }, { name: "Nume 2" }, { name: "Nume 3" }];

function List() {
  return namesList.map((item) => {
    return <p>{item.name}</p>;
  });
}

const Book = ({ img, title, author }) => {
  return (
    <article className="book">
      <img src={img} alt="yeah" />
      <h1>{title}</h1>
      <h4>{author}</h4>
      <p></p>
      <List />
    </article>
  );
};

ReactDom.render(<BookList />, document.getElementById("root"));
